import React, {Component} from 'react';
import './RightNav.css';

const RightNav = ({content}) => { 
    return (
        <div className="RightNav">
        	<div className="Header">
        	</div>
            <div className="Content">
                {content}
            </div>
        </div>
    );
}

export default RightNav;
